export const windowload = () => {
  return (anyname) => {
    fetch("https://jsonplaceholder.typicode.com/todos/1")
      .then((response) => response.json())
      .then((json) => {
        anyname({
          type: "ChangeName",
          payload: json.title,
        });
      });
  };
};


